    ((s = [0xFBDA].pack('n')) && RUBY_VERSION < '1.9.1' ? s : s.force_encoding('CP932')) => 'E53A'.freeze,
    ((s = [0xFBDB].pack('n')) && RUBY_VERSION < '1.9.1' ? s : s.force_encoding('CP932')) => 'E53B'.freeze,
    ((s = [0xFBDC].pack('n')) && RUBY_VERSION < '1.9.1' ? s : s.force_encoding('CP932')) => 'E53C'.freeze,
    ((s = [0xFBDD].pack('n')) && RUBY_VERSION < '1.9.1' ? s : s.force_encoding('CP932')) => 'E53D'.freeze,
    ((s = [0xFBDE].pack('n')) && RUBY_VERSION < '1.9.1' ? s : s.force_encoding('CP932')) => 'E53E'.freeze,
  }.freeze

  SOFTBANK_UNICODE_REGEXP = Regexp.union(*SOFTBANK_UNICODE.keys.map(&((RUBY_VERSION < '1.9.1') ?
                                                                  (lambda { |e|
                                                                     Regexp.new(Regexp.escape(e,'s'),nil,'s')
                                                                   }) :
                                                                  (lambda { |e|
                                                                     Regexp.new(Regexp.escape(e))
                                                                   })))).freeze
end
